import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  visitformScreen: {
    width: "85%",
    height: "90%",
    marginTop: 35,
    marginLeft: "auto",
    marginRight: "auto",
    display: "flex",
    flex: 1,
  },
  visitformContainer: {
    width: "100%",
    display: "flex",
    flex: 1,
    height: "100%",
    marginLeft: "auto",
    marginRight: "auto",
  },
});

export default styles;
